function Recognizer(skritter) {
    this.skritter = skritter;
    this.init_();
}

Recognizer.N_STROKES = 388;
// recognition can't be meaningfully applied (like # segments is wrong)
Recognizer.UNSCORED = .4;
Recognizer.JUST_WHATEVER_ALREADY_SCORE = 0.75;

Recognizer.prototype.init_ = function() {
    this.recognizers = [];
    this.loadedRecognizers = false;
    this.stunthogs = this.stunthogs();
    this.recog_params = this.recog_params();
    this.loadRecognizers();
};

// Gets a score for a squig being judged as a stroke of the given number.
Recognizer.prototype.recognize = function(strokeNum, squig) {
    if (!this.loadedRecognizers) {
      this.loadRecognizers();
    }
    return this.recognizers[strokeNum].recognize(squig);
};

Recognizer.prototype.load = function(strokeNum, params, sParams) {
    this.recognizers[strokeNum] = new StrokeRecognizer(strokeNum, params, sParams);
};

Recognizer.prototype.loadRecognizers = function() {
    if (this.loadedRecognizers) {
        return;
    }
    for (var bad in this.stunthogs)
      this.recog_params[parseInt(bad, 10)] = this.recog_params[this.stunthogs[bad]];

    for (var strokeNum = 0; strokeNum < this.N_STROKES; ++strokeNum) {
        var p = this.recog_params[strokeNum];
        if (!p.length) {
            throw "Got no recognizer for " + strokeNum;
        }
        this.load(strokeNum, p[0], p[1]);
    }
    this.loadedRecognizers = true;
};

